import { Header } from "../../Header/Header";
import "../Css/BalanceSty;e.css";

export const Balance = () => {
  return (
    <>
      <Header />
      <main className="balance-main">
        <div className="balance-container">
          <section></section>
        </div>
      </main>
    </>
  );
};
